import React from 'react'
import { connect } from 'react-redux';

const CurrentBrandItem = (props) => {
  console.log(props.currentBrand)
    return(
      <div>
        {props.currentBrand.name}
      </div>
    )
}

export default connect(
  state => ({
    currentBrand: state.brands.currentBrand,
  })
)(CurrentBrandItem);
